import React from "react";
import {
  Drawer as MUIDrawer,
  ListItem,
  List,
  ListItemIcon,
  ListItemText
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";
import { withRouter } from "react-router-dom";
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import clsx from 'clsx';

const useStyles = makeStyles({
  drawer: {
    width: "152px"
  },
  drawerPaper: {
    color: "#252F4A"
  },
  exit: {
    marginTop: 'auto'
  }
});

const flexContainer = {
  display: 'flex',
  flexDirection: 'column',
  justifyContent:"center",
  padding: 0,
  color: "#FFF",
};

const listIcon ={
  color: "#FFF",
  justifyContent: 'center'
};

const Drawer = props => {
  const { history } = props;
  const classes = useStyles();
  const itemsList = [
    {
      text: "Россети",
      icon: <InboxIcon />,
      onClick: () => history.push("/")
    },
    {
      text: "Кабинет",
      icon: <MailIcon />,
      onClick: () => history.push("/profile")
    }
  ];
  return (
    <MUIDrawer variant="permanent" className={classes.drawer}>
      <List>
        {itemsList.map((item, index) => {
          const { text, icon, onClick } = item;
          return (
            <ListItem button key={text} onClick={onClick} style={flexContainer}>
              {icon && <ListItemIcon style={listIcon}>{icon}</ListItemIcon>}
              <ListItemText primary={text} />
            </ListItem>
          );
        })}
        <ListItem button className={ clsx(classes.flexContainer, classes.exit)}>
          <ListItemIcon style={listIcon}>
            <ExitToAppIcon />
          </ListItemIcon>
          <ListItemText primary="Выход" />
        </ListItem>
      </List>


    </MUIDrawer>
  );
};

export default withRouter(Drawer);
